import * as React from 'react';
import Box from '@mui/material/Box';
import Tabs, {tabsClasses} from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';

export default function ScrollBar() {
  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  return (
    <Box sx={{ width: '100%', bgcolor: 'background.paper', color: 'gold',}}>

      <Tabs value={value} 
      onChange={handleChange} 
      centered variant='scrollable' 
      scrollButtons
      aria-label='visible arrows tabs example'
      sx={{
          [`&. ${tabsClasses.scrollButtons}`] : {
              '&.mui-disabled': {opacity:0.8},
          }
      }}  
      >

        <Tab label="Roses" /> 
        <Tab label="Bouquet" />
        <Tab label="Sunflower" />


        <Tab label="Small-box" /> 
        <Tab label="Box-large" />
        <Tab label="Box-ls" />

        <Tab label="Item One" /> 
        <Tab label="Item Two" />
        <Tab label="Item Three" />

        <Tab label="Item One" /> 
        <Tab label="Item Two" />
        <Tab label="Item Three" />

        <Tab label="Item One" /> 
        <Tab label="Item Two" />
        <Tab label="Item Three" />

        <Tab label="Item One" /> 
        <Tab label="Item Two" />
        <Tab label="Item Three" />
      </Tabs>
    </Box>
  );
}
